import React from 'react';
import "./Navbar.css";
import logo from "./comarca-logo-ok.png"

//BOOTSTRAP
import "bootstrap/dist/css/bootstrap.min.css";

import { img } from 'react-bootstrap';

function navbar( {item1, item2, item3} ) {
    return (
        <div className="navContainer">
            <img className="navLogo" src={logo} alt="comarca  de creadores logo" width="250px" height="52px" />
            <div className="linksContainer">
                <ul>
                    <li className="linkItem"> {item1} </li>
                    <li className="linkItem"> {item2} </li>
                    <li className="linkItem"> {item3} </li>
                </ul>
                <button className="cartButton">Carrito</button>
            </div>
        </div>
    );
};

export default navbar;

